import React from 'react'
import Pitsa from '../InfoContent/PitsaCard/PitsaCard'
import Sushi from '../InfoContent/Sushi/Sushi';
import Water from '../InfoContent/Water/Water';
import AdditCard from '../InfoContent/AdditCard/AdditCard';
import PitsaM from '../InfoContent/PitsaCard/MainContent/MainContent';
import SushiM from '../InfoContent/Sushi/MainContent/MainContent';
import WaterM from '../InfoContent/Water/MainContent/MainContent';
import AdditCardM from '../InfoContent/AdditCard/MainContent/MainContent'
import NavbarCard from '../NavbarCard/NavbarCard';
import Address from '../Address/Address';
import Aksiya from '../InfoContent/Aksiya/Aksiya';
import Deserts from '../InfoContent/Deserts/Deserts';
import DesertM from '../InfoContent/Deserts/MainContent/MainContent'

export default function Home() {
  return (
    <div className='bg-light'>
        <div className="container-xxl">
        <NavbarCard/>
        <Aksiya/>
        <Address/>
        <Pitsa>
            <h1>Пицца</h1>
            <PitsaM/>
        </Pitsa>
        <Sushi>
            <h1>Суши</h1>
            <SushiM/>
        </Sushi>
        <AdditCard>
          <h1>Закуски</h1>
          <AdditCardM/>
        </AdditCard>
        <Deserts>
          <h1>Десерты</h1>
          <DesertM/>
        </Deserts>
        <Water>
          <h1>Напитки</h1>
          <WaterM/>
        </Water>
        </div>
        
    </div>
  )
}
